import './catalog.css';
import React, { useState } from 'react';

const [selectedSection, setSelectedSection] = useState('');

const handleSectionClick = (section: string) => {
  setSelectedSection(section);
};

const renderSection = (sectionName: string) => (
  <p
    id={selectedSection === sectionName ? 'selected-section' : ''}
    className={`section ${selectedSection === sectionName ? 'selected' : ''}`}
    onClick={() => handleSectionClick(sectionName)}
  >
    {sectionName}
  </p>
);

function Catalog() {
  return (
    <div className="catalog">
      <div className="topbar">
        <p className="section" >Fruits</p>
        <p className="section" >Vegetables</p>
        <p className="section" >Meats</p>
        <p className="section" >Dry</p>
        <p className="section" >Pharmacy</p>
      </div>
    </div>
  )
}

export default Catalog;
